package day20

import (
	"testing"
)

func TestSmall(t *testing.T) {
	input := `S..
##.
E..`
	m, sol := SolvePuzzle(input)
	if len(sol) != 7 {
		t.Errorf("Calculated solution (%d) was not expected", sol)
	}

	Cheats(m, sol)
}

func TestSampleOne(t *testing.T) {
	input := `###############
#...#...#.....#
#.#.#.#.#.###.#
#S#...#.#.#...#
#######.#.#.###
#######.#.#...#
#######.#.###.#
###..E#...#...#
###.#######.###
#...###...#...#
#.#####.#.###.#
#.#...#.#.#...#
#.#.#.#.#.#.###
#...#...#...###
###############`
	result := Solve(input)
	if result != 0 {
		t.Errorf("Calculated solution (%d) was not expected", result)
	}
}

func TestSampleOneCheats(t *testing.T) {
	input := `###############
#...#...#.....#
#.#.#.#.#.###.#
#S#...#.#.#...#
#######.#.#.###
#######.#.#...#
#######.#.###.#
###..E#...#...#
###.#######.###
#...###...#...#
#.#####.#.###.#
#.#...#.#.#...#
#.#.#.#.#.#.###
#...#...#...###
###############`
	m, sol := SolvePuzzle(input)
	result := Cheats(m, sol)
	if len(result) != 11 {
		t.Errorf("Calculated solution (%d) was not expected", result)
	}
}

